import './App.css';
import { Switch, Route, Routes } from 'react-router-dom';

import HomePage from './pages/homepage/homepage.component';

const HatsPage=()=>(
  <div>
    <h1>Hats PAGE</h1>
  </div>
)

function App() {
  return (
    <div>
      <Routes>
        <Switch>
      <Route exact path='/' element={<HomePage/>}/>
      <Route path='/hats' element={<HatsPage/>}/>
      </Switch>
      </Routes>
    </div>
  );
}

export default App;
